I hear &quot;Lets get up off the earth.&quot;



k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Frank Sumption
Sent: Friday, November 30, 2007 4:41 PM
To: evp-itc@yahoogroups.com
Subject: RE: [EVP-ITC] Too much time on my hands



Friggin&#39; weird, there is voices in it! I set the box for fast scan, it
sounded like a Harley, then did some effects on it, various echos, and
reverbs, and pitch benders. 
This goes way beyond anything I can imagine to figure out how a voice is
made out of this--mind--spining--out of con--trol...(sounds of branin on
htting floor..)

 Frank-S





  _____  

You keep typing, we keep giving. Download Messenger and join the i&#39;m
Initiative now. Join
&lt;http://im.live.com/messenger/im/home/?source=CRM_WL_joinnow&gt;  in! 




